import {
  BrowserRouter as Router,
  Routes,
  Route
} from "react-router-dom";

//Importation des pages
import {Home} from "./pages/Home";
import {Update} from "./pages/Update";

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Home />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
